articles.contents:
The information on this page is a combination of manually gathered information about the various plants and automatic scrape of the webpages of efferus. The majority of the information is taken from efferus, which is a great resource of information in Norwegian about plants and trees that can be grown in Norway, with particular focus on forest gardens and permaculture.
All information about height and width are approximations. The size of plants may vary substantially between different grow conditions. Height and width here are mainly given as maxima of full potential, and they might grow smaller in your area.
In the case of trees that are grafted, the sizes of these depend on the plant they are grafted on to. In such cases, the height and width are a product of the main plant, not the fruiting plant. Since our garden is not too large, we have chosen these trees to be small, despite the possibility of having them larger.


.l-body{
