  position: relative;
  margin-left: -45vw;
  margin-top: 100px;
  left: 45%;
}

.tag {
  display: inline-block;
  padding: 5px 12px;
  border-radius: 15px;
  font-weight: 600;
  font-size: 15px;
  height: 40px;
  text-align: center;
}

.plant-image {
  object-fit: cover;
  object-position: 0 100%;
  display: inline-block;
  overflow: hidden;

  width: 100%;
  height: 100px;
}

.img {
  object-fit: contain;
}













